            <div className="wrapper">
                <h1><div class={`fi fi-${props.attributes.c1alpha2} fis`}></div> <div class={`fi fi-${props.attributes.c2alpha2} fis`}></div>Match Name</h1>
                <div className="TotalReviews"></div>
